import { Route, Switch } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import QuoteDetail from "./pages/QuoteDetail";
import AddQuote from "./pages/AddQuote";

function App() {
  return (
    <main>
      <Switch>
        <Route path="all">
          <AllQuotes />
        </Route>
        <Route path="/quote-detail" exact>
          <QuoteDetail />
        </Route>
        <Route path="/AddQuote">
          <AddQuote />
        </Route>
      </Switch>
    </main>
  );
}

export default App;
